import React, { Component } from 'react';
import './Image.css';

class Image extends Component {
	render() {

		const image = {
			backgroundImage: `url(../media/images/${this.props.name}.png)`
		};

		return (
			<div className="Image" style={image}>

			</div>
		);
	}
}

export { Image };
